import axios from 'axios';

const endPoint = 'https://api.nytimes.com/svc/books/v3';
const fiction = '/lists/2011-02-13/Hardcover Nonfiction.json'
const key = '?api-key=yIY9ATTla1XKYKfDb1cb9pMz4kXKMiJK'



const fetchDataNy = async () => {
    try {
        const data = await axios.get(endPoint+fiction+key);
        console.log(data)
        return data;
    } catch (error) {
        console.log(`error ${error}`)

        return error;
    }
}

export default fetchDataNy
